  <div className="p-4">
    <h2 className="text-2xl font-bold">Projects</h2>
    <ul className="list-disc list-inside mt-2">
      <li>Project One - Description</li>
      <li>Project Two - Description</li>
    </ul>
  </div>
);
export default Projects;
